showModal = () => {
    this.setState({
      visible: true,
    });
  }
handleOk = () => {
    this.setState({
      visible: false,
    });
  }
handleCancel = () => {
    this.setState({
      visible: false,
    });
  }

<Button type="primary" onClick={this.showModal}>Open</Button>
<Modal
    title="Basic Modal"
    visible={this.state.visible}
    onOk={this.handleOk}
    onCancel={this.handleCancel}
>
<p></p>
</Modal>

